                        {isAuthenticated()?(<li className="nav-item"><Link className="nav-link" to="/dashboard" >Dashboard</Link></li>):null}
                        {isAuthenticated()?(<li className="nav-item"><a className="nav-link"  onClick={props.logoutUser} style={{cursor:"pointer"}} >Logout</a></li>):null}
